<html>

<head>
<meta name="GENERATOR" content="Microsoft FrontPage 4.0">
<title>Image Cutter Output File</title>
<link rel="stylesheet" type="text/css" href="custom.css">
</head>

<body topmargin="0" bgcolor="#D7D8F4">
<div align="center">
  <center>
<table border="0" cellspacing="0" cellpadding="0" height="90" width="780">
  <tr>
    <td height="54" width="259"><img src="banner1.jpg" height="54" width="259" border="0"></td>
    <td height="54" width="521" background="banner2.jpg" valign="middle" align="center">
      <p class="logohead">#LOGO#</p>
    </td>
  </tr>
  <tr>
    <td height="36" width="259"><img src="banner3.jpg" height="36" width="259" border="0"></td>
    <td height="36" width="521" background="banner4.jpg" valign="middle" align="center">
      <p class="logosub">#SLOGAN#</p>
    </td>
  </tr>
</table>
  </center>
</div>
<div align="center">
  <center>
  <table border="0" cellpadding="0" cellspacing="0" width="780" bgcolor="#FFFFFF">
    <tr>
      <td valign="top" align="left" width="175">
        <table border="0" cellpadding="0" cellspacing="0" width="175">
          <tr>
            <td valign="middle" align="center">#LOGOIMG#</td>
          </tr>
          <tr>
            <td>#VMENU#</td>
          </tr>
          <tr>
            <td height="12"><img border="0" src="blank.gif" width="1" height="1"></td>
          </tr>
          <tr>
            <td align="center">
              <p align="center"><img border="0" src="userimages/_userimg-varphoto4.jpg" width="89" height="90"></td>
          </tr>
          <tr>
            <td>
              <p class="boxcontent1">#BOX1#</td>
          </tr>
        </table>
      </td>
      <td width="605" valign="top" align="left">
        <div align="center">
          <table border="0" cellpadding="4" cellspacing="0" width="605">
            <tr>
              <td>
                <p class="sohotext">#CONTENT#</td>
            </tr>
          </table>
        </div>
      </td>
    </tr>
  </table>
  </center>
</div>
<div align="center">
  <center>
  <table border="0" cellpadding="0" cellspacing="0" width="780">
    <tr>
      <td valign="middle" align="center" height="22" bgcolor="#020066">
        <p class="SMtext"><font color="#D7D8F4">#COPYRIGHT#</font></td>
    </tr>
  </table>
  </center>
</div>
<p>#CUSTOMINC#</p>
</body>
</html>
